    true,nt"url": null,nt"notes": "The electronic Official Personnel Folder
    (eOPF) Master Forms list includes Permanent and Temporary forms that are consistent
    with the U.S. Office of Personnel Management (OPM)'s Guide to Data Standards, Guide
    to Personnel Recordkeeping, and the Guide to Processing Personnel Actions.  The
    eOPF Master Forms List identifies information used for indexing to retrieve documentation
    once in eOPF.  Two examples of identified information are (1) Form Number -- a form's
    unique identifier that generally includes a combination of alpha and numeric characters
    -- and (2) Form Title -- a narrative description of form function that may include
    common government abbreviations and acronyms. Also included is a listing of the
    OPM Nature of Action (NOA) codes.  NOA codes are the specific personnel action used
    to create or change a civilian personnel record. The eOPF Master Forms List located
    on the site is not all inclusive. For a complete listing of your agency's eOPF Forms
    List, contact the program management office at the email address in this inventory
